var instructions = [
    "",
    "",
    "",
    "",
    ""
]

var keypad = [
    ["0", "0", "1", "0", "0"],
    ["0", "2", "3", "4", "0"],
    ["5", "6", "7", "8", "9"],
    ["0", "A", "B", "C", "0"],
    ["0", "0", "D", "0", "0"]
]
var curarr = 2;
var curval = 2;
instructions.forEach(function(value, index, array) {
    for (var i = 0; i < value.length; i++) {
        var next = value[i];
        if (next == "U" && curarr != 0) {
            if (keypad[curarr - 1][curval] != "0") {
                curarr--;
            }
        }
        if (next == "D" && curarr != 4) {
            if (keypad[curarr + 1][curval] != "0") {
                curarr++;
            }
        }
        if (next == "L" && curval != 0) {
            if (keypad[curarr][curval - 1] != "0") {
                curval--;
            }
        }
        if (next == "R" && curval != 4) {
            if (keypad[curarr][curval + 1] != "0") {
                curval++;
            }
        }
    }
    console.log(keypad[curarr][curval]);
});
